DROP TABLE IF EXISTS `torgnization`;
CREATE TABLE `torgnization` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '机构表主键',
  `acount_name` varchar(50) NOT NULL,
  `pwd` varchar(50) NOT NULL,
  `linkman_id` bigint(20) DEFAULT NULL COMMENT '创始人id',
  `name_cn` varchar(255) DEFAULT NULL COMMENT '机构文中名称',
  `name_en` varchar(255) DEFAULT NULL COMMENT '构机英文名称',
  `logo_url` varchar(255) DEFAULT NULL COMMENT '账号头像',
  `type` tinyint(4) DEFAULT NULL COMMENT '企业类型：0表示平台，1表示机构，2表示会员',
  `regist_time` datetime NOT NULL,
  `auth_apply_time` datetime DEFAULT NULL COMMENT '申请认证时间',
  `auth_pass_time` datetime DEFAULT NULL COMMENT '认证通过时间',
  `expire_time` datetime DEFAULT NULL COMMENT '会员到期时间',
  `freeze_time` datetime DEFAULT NULL,
  `unfreeze_time` datetime DEFAULT NULL,
  `last_login_time` datetime DEFAULT NULL COMMENT '最后一次登录时间',
  `level_id` int(11) DEFAULT NULL COMMENT '机构等级',
  `activity_id` int(11) DEFAULT NULL COMMENT '活跃度',
  `district_id` int(11) DEFAULT NULL COMMENT '最低一级行政区id，可关联到国家-省-市-区',
  `address_cn` varchar(255) DEFAULT NULL COMMENT '机构中文地址',
  `address_en` varchar(255) DEFAULT NULL COMMENT '机构英文地址',
  `contacts_info_id` bigint(20) DEFAULT NULL,
  `alipay_account` varchar(100) DEFAULT NULL,
  `alipay` varchar(100) DEFAULT NULL,
  `official_website` varchar(255) DEFAULT NULL COMMENT '官网地址',
  `taobao_url` varchar(255) DEFAULT NULL COMMENT '淘宝店铺',
  `jd_url` varchar(255) DEFAULT NULL COMMENT '京东店铺',
  `suning_url` varchar(255) DEFAULT NULL COMMENT '苏宁店铺',
  `weibo_url` varchar(255) DEFAULT NULL COMMENT '微博店铺',
  `weixin_url` varchar(255) DEFAULT NULL COMMENT '微信公众号',
  `main_business` varchar(255) DEFAULT NULL COMMENT '主营业务',
  `service_range` varchar(255) DEFAULT NULL COMMENT '服务产品范围',
  `status` tinyint(4) NOT NULL COMMENT '0:无效 1:有效 2:申请认证',
  `pwd_token` varchar(50) DEFAULT NULL,
  `qq_openid` varchar(255) DEFAULT NULL,
  `qq_access_token` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `qq_openid` (`qq_openid`),
  KEY `linkman_id` (`linkman_id`) USING BTREE,
  KEY `level_id` (`level_id`) USING BTREE,
  KEY `activity_id` (`activity_id`) USING BTREE,
  KEY `contacts_info_id` (`contacts_info_id`) USING BTREE,
  CONSTRAINT `torgnization_ibfk_1` FOREIGN KEY (`linkman_id`) REFERENCES `tmember` (`id`),
  CONSTRAINT `torgnization_ibfk_2` FOREIGN KEY (`level_id`) REFERENCES `tlevel` (`id`),
  CONSTRAINT `torgnization_ibfk_3` FOREIGN KEY (`activity_id`) REFERENCES `tactivity` (`id`),
  CONSTRAINT `torgnization_ibfk_4` FOREIGN KEY (`contacts_info_id`) REFERENCES `tcontacts_info` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=959 DEFAULT CHARSET=utf8;

